import styled from 'styled-components';

const RecommendationsWrapper = styled.div`
  margin: 110px 0 120px 0;

  .recommendations__title {
    font-weight: 700;
    font-size: 40px;
    line-height: 60px;
    color: #0D1821;
  }
`;

export default RecommendationsWrapper;
